import React from "react";
import "./styles/Home.css";
import { CSSTransition } from "react-transition-group";

function Home() {
  return (
    <CSSTransition
      classNames="title-transition"
      timeout={5000}
      in={true}>
      <h3 className={"title-text"}>Hi, I'm James.</h3>
    </CSSTransition>
  );
}

export default Home;
